import React from "react";

type Props = {
  questions: string;
  answer: string[];
  callback: any;
  userAnswer: string;
  questionNumber: number;
  totalQuestions: number;
};
const QuestionCard: React.FC<Props> = ({
  questions,
  answer,
  callback,
  userAnswer,
  questionNumber,
  totalQuestions,
}) => (<div>Question Card</div>);

export default QuestionCard;
